-- Current approach.
if object_id('tempdb..#LOXML') is not null drop table #LOXML;
create table #LOXML
	(
	tablename varchar(4000) collate database_default,
	CustomerID varchar(10) collate database_default,
	DistChannel varchar(10) collate database_default,
	Division varchar(10) collate database_default,
	SalesOrg varchar(10) collate database_default,
	StartDate char(8) collate database_default,
	EndDate char(8) collate database_default,
	OrderNumber	varchar(10) collate database_default,
	CSOOrderNumber varchar(4000) collate database_default,
	OrderReason varchar(10) collate database_default,
	Planned varchar(10) collate database_default,
	PlannedTime varchar(10) collate database_default,
	Currency varchar(10) collate database_default,
	Truck varchar(10) collate database_default,
	ShipCondition varchar(10) collate database_default,
	Complete varchar(10) collate database_default,
	CreditBlock varchar(10) collate database_default,
	Shift varchar(10) collate database_default,
	DriverID varchar(10) collate database_default,
	NetAmount varchar(50) collate database_default,
	GrossAmount varchar(50) collate database_default,
	RequiredDeliveryDate varchar(50) collate database_default,
	PlannedDate varchar(50)	collate database_default,
	CardId varchar(10) collate database_default,
	TripNr varchar(5) collate database_default,
	VehicleId varchar(10) collate database_default,
	PoNumber nvarchar(20) collate database_default
	)

if object_id('tempdb..#LOLIXML') is not null drop table #LOLIXML;	
create table #LOLIXML
	(
	tablename varchar(4000) collate database_default,
	OrderNumber	varchar(10) collate database_default,
	Item varchar(4000) collate database_default,
	Material varchar(18) collate database_default,
	Quantity varchar(20) collate database_default,
	UOM varchar(5) collate database_default,
	NetValue varchar(20) collate database_default,
	Currency varchar(5) collate database_default,
	TankNumber varchar(20) collate database_default,
	GrossAmount varchar(20) collate database_default,
	Plant varchar(4) collate database_default,
	PaymentTerm varchar(1) collate database_default
	)

set nocount on
declare @ndoc int, @nRet int, @xml xml, @dtStart datetime = getdate(), @nRows int;
select @nRows = count(*) from TheXml

declare curXml cursor local static for 
select data from TheXml

open curXml
while 1 = 1 begin
	fetch next from curXml into @xml
	if @@fetch_status = -1 break
	
	exec @nRet = sp_xml_preparedocument @ndoc output, @xml
	
insert into #LOXML
	(
	tablename,
	CustomerID, DistChannel, Division, SalesOrg, StartDate, EndDate,
	OrderNumber, CSOOrderNumber, OrderReason, Planned, PlannedTime,
	Currency, Truck, ShipCondition, Complete, CreditBlock, Shift,
	DriverID, NetAmount, GrossAmount, RequiredDeliveryDate, PlannedDate,
	CardId, TripNr, VehicleId, PoNumber
	)
select
	tablename,
	CustomerID, DistChannel, Division, SalesOrg, StartDate, EndDate,
	OrderNumber, CSOOrderNumber, OrderReason, Planned, PlannedTime,
	Currency, Truck, ShipCondition, Complete, CreditBlock, Shift,
	DriverID, NetAmount, GrossAmount, RequiredDeliveryDate, PlannedDate,
	CardId, TripNr, VehicleId, PoNumber
from
	openxml (@ndoc, '/Function/Tables/Table/Row',1) with
	(
		tablename varchar(4000)  '../@name',
		CustomerID varchar(10)  '../../../ExportParameters/@CUSTOMER',
		DistChannel varchar(10)  '../../../ExportParameters/@DIST_CHANNEL',
		Division varchar(10)  '../../../ExportParameters/@DIVISION',
		SalesOrg varchar(10)  '../../../ExportParameters/@SALES_ORG',
		StartDate char(8) '../../../ExportParameters/@START_DATE',
		EndDate char(8) '../../../ExportParameters/@END_DATE',
		OrderNumber varchar(10),
		CSOOrderNumber	varchar(4000),
		OrderReason varchar(10),
		Planned varchar(10),
		PlannedTime varchar(10),
		Currency varchar(10),
		Truck varchar(10),
		ShipCondition varchar(10),
		Complete varchar(10),
		CreditBlock varchar(10) '@CreditBlock',
		Shift varchar(10),
		DriverID varchar(10),
		NetAmount varchar(50),
		GrossAmount varchar(50),
		RequiredDeliveryDate varchar(50),
		PlannedDate varchar(50),
		CardId varchar(10),
		TripNr varchar(5),
		VehicleId varchar(10),
		PoNumber nvarchar(20)
	) X

	
	insert into #LOLIXML
		(
		tablename,
		OrderNumber, Item, Material, Quantity, UOM, NetValue,
		Currency, TankNumber, GrossAmount, Plant, PaymentTerm
		)
	select
		tablename,
		OrderNumber, Item, Material, Quantity, UOM, NetValue,
		Currency, TankNumber, GrossAmount, Plant, PaymentTerm
	from	
		OPENXML (@ndoc, '/Function/Tables/Table/Row',1)
		WITH 
			(tablename varchar(4000)  '../@name',
			OrderNumber	varchar(10),
			Item	varchar(4000),
			Material varchar(18),
			Quantity varchar(20),
			UOM varchar(5),
			NetValue varchar(20),
			Currency varchar(5),
			TankNumber varchar(20),
			GrossAmount varchar(20),
			Plant varchar(4),
			PaymentTerm varchar(1)
		) X	
	
	
	exec sp_XML_RemoveDocument @ndoc
end

close curXml
deallocate curXml


select 'Current approach takes ' + cast(datediff(ms, @dtStart, getdate()) as varchar(255)) + ' msec for ' + cast(@nRows as varchar) + ' rows.'



